  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Northeastern
  Montana Wetland Management District outlines District accomplishments during the
  1980 calendar year. The report begins with an introduction to the WMD and information
  about weather conditions, habitat conditions, land acquisition activities, and the
  system status. Construction and maintenance are also described. Habitat management
  is covered; croplands, grasslands, wetlands, and easements for waterfowl management
  are discussed. The wildlife section of the report discusses endangered and threatened
  species, migratory birds, mammals, and non-migratory birds. Interpretation and recreation
  activities are outlined; topics include information and interpretation, recreation,
  and law enforcement. Cooperative programs are attached.\",\n\t\"license_title\":
